import Button from "react-bootstrap/Button";
import { Container } from "react-bootstrap";
import Card from "react-bootstrap/Card";
import { Row } from "react-bootstrap";
import { Col } from "react-bootstrap";
import Alert from "react-bootstrap/Alert";

import "bootstrap/dist/css/bootstrap.min.css";
import { useNavigate } from "react-router-dom";

function VictimReqMain() {
  const styles = {
    cardImg: {
      width: "15vw",
      height: "9vw",
      padding: "10px",
    },
    btn: {
      color: "",
      backgroundColor: "",
    },
  };
  const navigate = useNavigate();
  return (
    <>
      <div style={{ margin: "auto", width: "50%" }} className="mt-5 mb-5">
        <Card style={{ width: "35rem" }} classNam="mt-5 m">
          <Alert>
            <Alert.Heading className="d-flex justify-content-center">
              SEND RESCUE & RELIEF REQUEST
            </Alert.Heading>
            <div className="d-flex justify-content-end pt-3">
              Victim Id:1212
            </div>
          </Alert>
          <Row>
            <Col sm={6}>
              <Card.Img
                style={styles.cardImg}
                src={require("../../images/rescue.png")}
              />
            </Col>

            <Col sm={6}>
              <div className="d-flex justify-content-end mt-5">
                <Button
                  onClick={() => {
                    navigate("/RescueForm");
                  }}
                >
                  Rescue Request
                </Button>
              </div>
            </Col>
          </Row>
          <hr />
          <Row>
            <Col sm={6}>
              <Card.Img
                style={styles.cardImg}
                src={require("../../images/medical.png")}
              />
            </Col>
            <Col sm={6}>
              <div className="d-flex justify-content-end mt-5">
                <Button>Food & Medical Request</Button>
              </div>
            </Col>
          </Row>
          <hr />
          <Row>
            <Col sm={6}>
              <Card.Img
                style={styles.cardImg}
                src={require("../../images/shelter.png")}
              />
            </Col>
            <Col sm={6}>
              <div className="d-flex justify-content-end mt-5">
                <Button>Shelter Request</Button>
              </div>
            </Col>
          </Row>
        </Card>
      </div>
    </>
  );
}

export default VictimReqMain;
